import { motion } from "framer-motion";
import React, { FunctionComponent } from "react";
import styles from "../styles/Play.module.css"

type ButtonProps = {
    classN: string;
    lid?: string;
    onClicK: any;
};

const Button: FunctionComponent<ButtonProps> = ({ classN, children, lid, onClicK, setselected}) => {
    return(
        <motion.div onClicK={() => setselected()} layoutId={lid} className={classN}>
            <div className={styles.inside}>{children}</div>
        </motion.div>
    );
};

export default Button;
